public class Mark2025 {
    // Step 1: Private fields
    private int powerLevel;

    // Step 2: Public getter
    public int getPowerLevel() {
        return powerLevel;
    }

    // Step 2: Public setter with validation
    public void setPowerLevel(int powerLevel) {
